import { ArrowRight, User, Archive, Image as ImageIcon } from 'lucide-react'; // Renamed Image to ImageIcon to avoid conflict
import Image from 'next/image';
import Link from 'next/link';
interface HorizontalCardProps {
  title: string;
  image: string | null;
  subtitle?: string;
  link?: string;
  variant?: string;
  year?: number;
  priority?: boolean;

  category?: 'craftsmen' | 'archive' | 'general';
}

const HorizontalCard = ({
  title,
  image,
  subtitle,
  variant,
  year,
  link = "#",
  priority = false,
  category = 'general'
}: HorizontalCardProps) => {

  //  to render the correct icon based on category
  const renderFallbackIcon = () => {
    const iconProps = { size: 64, strokeWidth: 1 };

    switch (category) {
      case 'craftsmen':
        return
        <svg width="74" height="73" viewBox="0 0 74 73" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
          <rect opacity="0.4" width="74" height="73" fill="url(#pattern0_504_1593)" />
          <defs>
            <pattern id="pattern0_504_1593" patternContentUnits="objectBoundingBox" width="1" height="1">
              <use xlinkHref="#image0_504_1593" transform="matrix(0.00195312 0 0 0.00197988 0 -0.00684932)" />
            </pattern>
            <image id="image0_504_1593" width="512" height="512" preserveAspectRatio="none" xlinkHref="data:image/png;base64," />
          </defs>
        </svg>

          ;
      case 'archive':
        return
        <svg width="64" height="64" viewBox="0 0 64 64" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
          <rect opacity="0.4" width="64" height="64" fill="url(#pattern0_504_1590)" />
          <defs>
            <pattern id="pattern0_504_1590" patternContentUnits="objectBoundingBox" width="1" height="1">
              <use xlinkHref="#image0_504_1590" transform="scale(0.00195312)" />
            </pattern>
            <image id="image0_504_1590" width="512" height="512" preserveAspectRatio="none" xlinkHref="data:image/png;base64," />
          </defs>
        </svg>

          ;
      case 'general':
      default:
        // Using Lucide's Image icon for general placeholder
        return <ImageIcon {...iconProps} />;
    }
  };

  return (
    <Link
      href={link}
      className="group block border border-[#2D2D2D] bg-transparent hover:bg-[#2D2D2D] transition-all duration-300 p-2 xl:p-4"
    >
      <div
        className={`relative w-full overflow-hidden bg-[#f0f0f0] ${variant === "secondary"
          ? "aspect-[3/4] "
          : "aspect-[5/3]"
          }`}
      >
        {image ? (
          <Image
            src={image}
            alt={title}
            fill
            className="object-cover transition-transform duration-500 group-hover:scale-105"
            priority={priority}
          />
        ) : (
          <div className="w-full h-full flex items-center justify-center text-gray-400">
            {/* Render the icon based on the interface category */}
            {renderFallbackIcon()}
          </div>
        )}
      </div>

      <div className="flex mt-2 xl:mt-4 justify-between items-center transition-colors duration-300 group-hover:text-white">
        <div className="flex flex-col justify-center gap-2">
          <span className="font-raleway text-lg xl:text-2xl font-medium leading-tight">
            {title}
            <span className='text-[#8d8d8d] group-hover:text-gray-300 transition-colors ml-2'>
              {year != null ? '/ ' + year : ''}
            </span>
          </span>
          {subtitle && (
            <span className="font-raleway text-gray-500 text-lg xl:text-2xl font-medium leading-tight">
              {subtitle}
            </span>
          )}
        </div>
        <div>
          <ArrowRight
            size={18}
            strokeWidth={1.5}
            className="transform transition-transform duration-300 group-hover:translate-x-1"
          />
        </div>
      </div>
    </Link>
  );
}

export default HorizontalCard;